import React from "react"

function Nav() {
    return (
        <nav className="nav">
            <div className="logo-box">
                <a className="nav-link" href="#">
                    <img src="./images/vgrade-logo.png"></img>
                </a>
            </div>
        </nav>
    );
}

export default Nav;
